// Shadowdark character generator - script.js
document.addEventListener("DOMContentLoaded", () => {
  // ----- Data Tables -----

  // ----- DOM References -----
  const classSelect = document.getElementById("classSelect");
  const raceSelect = document.getElementById("raceSelect");
  const bgSelect = document.getElementById("bgSelect");
  const statMethod = document.getElementById("statMethod");
  const generateBtn = document.getElementById("generateBtn");
  const regenStatsBtn = document.getElementById("regenStatsBtn");
  const exportJsonBtn = document.getElementById("exportJsonBtn");
  const copyBtn = document.getElementById("copyBtn");

  // Add new button dynamically for randomness
  const randomAllBtn = document.createElement("button");
  randomAllBtn.id = "randomAllBtn";
  randomAllBtn.textContent = "Total Random";
  document.querySelector(".buttons").appendChild(randomAllBtn);

  const nameEl = document.getElementById("name");
  const classRaceEl = document.getElementById("classRace");
  const backgroundEl = document.getElementById("background");
  const backgroundE2 = document.getElementById("backgroundDescription");
  const notesEl = document.getElementById("notes");
  const rollLog = document.getElementById("rollLog");

  const strEl = document.getElementById("str");
  const dexEl = document.getElementById("dex");
  const conEl = document.getElementById("con");
  const intEl = document.getElementById("int");
  const wisEl = document.getElementById("wis");
  const chaEl = document.getElementById("cha");

  const modStrEl = document.getElementById("modStr");
  const modDexEl = document.getElementById("modDex");
  const modConEl = document.getElementById("modCon");
  const modIntEl = document.getElementById("modInt");
  const modWisEl = document.getElementById("modWis");
  const modChaEl = document.getElementById("modCha");

  const gearList = document.getElementById("gearList");

  // ----- Utility Functions -----
  const rollDie = (sides) => Math.floor(Math.random() * sides) + 1;
  const rollNDice = (n, s) => Array.from({ length: n }, () => rollDie(s));
  const modifier = (s) => Math.floor((s - 10) / 2);
  const signed = (n) => (n >= 0 ? `+${n}` : `${n}`);

  const randFrom = (arr) => arr[Math.floor(Math.random() * arr.length)];

  const NAME_SYLLABLES = ["gar", "mar", "sil", "dor", "kel", "ael", "ryn", "thor", "bel", "nor", "ven", "ur", "lan", "sha", "ri"];
  function randomName() {
    const syllables = 2 + Math.floor(Math.random() * 2);
    let name = "";
    for (let i = 0; i < syllables; i++) {
      const s = randFrom(NAME_SYLLABLES);
      name += i === 0 ? s.charAt(0).toUpperCase() + s.slice(1) : s;
    }
    if (Math.random() < 0.25) {
      const ep = ["the Bold", "the Quiet", "of the Dusk", "Stoneborn", "Ironhand"];
      name += " " + randFrom(ep);
    }
    return name;
  }

  const roll4d6DropLowest = () => {
    const rolls = rollNDice(4, 6);
    const sum = rolls.reduce((a, b) => a + b, 0) - Math.min(...rolls);
    return { rolls, sum };
  };
  const roll3d6 = () => {
    const rolls = rollNDice(3, 6);
    const sum = rolls.reduce((a, b) => a + b, 0);
    return { rolls, sum };
  };

  function rollAbilities(method = "4d6dl") {
    const abilities = ["str", "dex", "con", "int", "wis", "cha"];
    const result = {};
    const lines = [];
    for (const ab of abilities) {
      const r = method === "3d6" ? roll3d6() : roll4d6DropLowest();
      result[ab] = r.sum;
      lines.push(`${ab.toUpperCase()}: [${r.rolls.join(", ")}] -> ${r.sum}`);
    }
    return { scores: result, log: lines.join("\n") };
  }

  const findById = (arr, id) => arr.find((x) => x.id === id) || arr[0];

  // ----- Core Character Creation -----
  // ----- Helper: apply a standard array object to scores -----

  function getModifierForScore(score) {
    for (const entry of MODIFIERS) {
      if (score >= entry.minscore && score <= entry.maxscore) {
        return entry.mod;
      }
    }
    return 0; // fallback, though it should never happen
  }

  function applyStandardArray(stdObj) {
    // stdObj example: { id: "fighter1", str: "15", dex: "13", ... }
    return {
      str: Number(stdObj.str),
      dex: Number(stdObj.dex),
      con: Number(stdObj.con),
      int: Number(stdObj.int),
      wis: Number(stdObj.wis),
      cha: Number(stdObj.cha),
    };
  }

  // ----- Core Character Creation (REPLACE existing createCharacter) -----
  function createCharacter(randomizeAll = false) {
    let classObj, raceObj, background;

    if (randomizeAll) {
      classObj = randFrom(CLASSES);
      raceObj = randFrom(RACES);
      background = randFrom(BACKGROUNDS);
      classSelect.value = classObj.id;
      raceSelect.value = raceObj.id;
      bgSelect.value = background.id;
    } else {
      classObj = findById(CLASSES, classSelect.value);
      raceObj = findById(RACES, raceSelect.value);
      background = findById(BACKGROUNDS, bgSelect.value);
    }

    // Decide scores depending on selected stat method
    let scores;
    let rollLogText = "";

    if (statMethod.value === "manual") {
      // manual: default 10s (UI for manual editing not implemented here)
      scores = { str: 10, dex: 10, con: 10, int: 10, wis: 10, cha: 10 };
      rollLogText = "Manual entry selected — default 10s.";
    } else if (statMethod.value === "standard") {
      // standard arrays by class
      const candidates = STANDARDARRAYS.filter((sa) => sa.id.startsWith(classObj.id));
      const chosen = candidates.length ? randFrom(candidates) : randFrom(STANDARDARRAYS);
      scores = applyStandardArray(chosen);
      rollLogText = `Standard array chosen: ${chosen.id} — STR:${chosen.str} DEX:${chosen.dex} CON:${chosen.con} INT:${chosen.int} WIS:${chosen.wis} CHA:${chosen.cha}`;
    } else {
      // rolling methods - use your rollAbilities function
      const rolled = rollAbilities(statMethod.value);
      // rollAbilities returns numbers already
      scores = { ...rolled.scores };
      rollLogText = rolled.log;
    }

    // Always compute modifiers from the finalized scores using your MODIFIERS table:
    const mods = {
      str: getModifierForScore(Number(scores.str)),
      dex: getModifierForScore(Number(scores.dex)),
      con: getModifierForScore(Number(scores.con)),
      int: getModifierForScore(Number(scores.int)),
      wis: getModifierForScore(Number(scores.wis)),
      cha: getModifierForScore(Number(scores.cha)),
    };

    const gear = [...classObj.gear, "Pack: basic adventuring gear"];

    return {
      name: randomName(),
      class: classObj,
      race: raceObj,
      background,
      scores,
      mods, // now always present
      gear,
      log: rollLogText,
    };
  }

  // ----- Render -----
  function renderCharacter(c) {
    nameEl.textContent = c.name;
    classRaceEl.textContent = `${c.class.name} — ${c.race.name}`;
    backgroundEl.textContent = `Background: ${c.background.name} - ${c.background.description}`;
    notesEl.textContent = `Hit die: ${c.class.hd}`;

    const s = c.scores;
    const m = c.mods || { str: 0, dex: 0, con: 0, int: 0, wis: 0, cha: 0 };

    // Show "score (±mod)" format. If score is not a number (initial placeholders), keep raw text.
    const fmt = (score, mod) => {
      const n = Number(score);
      if (Number.isNaN(n)) return String(score);
      return `${n} (${mod >= 0 ? "+" : ""}${mod})`;
    };

    strEl.textContent = fmt(s.str, m.str);
    dexEl.textContent = fmt(s.dex, m.dex);
    conEl.textContent = fmt(s.con, m.con);
    intEl.textContent = fmt(s.int, m.int);
    wisEl.textContent = fmt(s.wis, m.wis);
    chaEl.textContent = fmt(s.cha, m.cha);

    modStrEl.textContent = `STR mod: ${m.str >= 0 ? "+" : ""}${m.str}`;
    modDexEl.textContent = `DEX mod: ${m.dex >= 0 ? "+" : ""}${m.dex}`;
    modConEl.textContent = `CON mod: ${m.con >= 0 ? "+" : ""}${m.con}`;
    modIntEl.textContent = `INT mod: ${m.int >= 0 ? "+" : ""}${m.int}`;
    modWisEl.textContent = `WIS mod: ${m.wis >= 0 ? "+" : ""}${m.wis}`;
    modChaEl.textContent = `CHA mod: ${m.cha >= 0 ? "+" : ""}${m.cha}`;

    gearList.innerHTML = "";
    c.gear.forEach((g) => {
      const li = document.createElement("li");
      li.textContent = g;
      gearList.appendChild(li);
    });

    rollLog.textContent = c.log;
  }

  // ----- Export / Copy -----
  function downloadJSON(obj, filename = "character.json") {
    const blob = new Blob([JSON.stringify(obj, null, 2)], { type: "application/json" });
    const url = URL.createObjectURL(blob);
    const a = document.createElement("a");
    a.href = url;
    a.download = filename;
    a.click();
    setTimeout(() => URL.revokeObjectURL(url), 1000);
  }

  async function copyToClipboard(text) {
    if (navigator.clipboard) {
      await navigator.clipboard.writeText(text);
      alert("Character copied to clipboard.");
    } else alert("Clipboard unavailable.");
  }

  // ----- Event Listeners -----
  function populateSelects() {
    CLASSES.forEach((c) => {
      const o = document.createElement("option");
      o.value = c.id;
      o.textContent = c.name;
      classSelect.appendChild(o);
    });
    RACES.forEach((r) => {
      const o = document.createElement("option");
      o.value = r.id;
      o.textContent = r.name;
      raceSelect.appendChild(o);
    });
    BACKGROUNDS.forEach((b) => {
      const o = document.createElement("option");
      o.value = b.id;
      o.textContent = b.name;
      bgSelect.appendChild(o);
    });
  }

  generateBtn.addEventListener("click", () => {
    const c = createCharacter(false);
    renderCharacter(c);
    window._lastChar = c;
  });

  randomAllBtn.addEventListener("click", () => {
    const c = createCharacter(true);
    renderCharacter(c);
    window._lastChar = c;
  });

  regenStatsBtn.addEventListener("click", () => {
    const rolled = rollAbilities(statMethod.value);
    // Create temporary character-like object to show scores + mods in UI without changing other fields
    const tempScores = { ...rolled.scores };
    const tempMods = {
      str: getModifierForScore(Number(tempScores.str)),
      dex: getModifierForScore(Number(tempScores.dex)),
      con: getModifierForScore(Number(tempScores.con)),
      int: getModifierForScore(Number(tempScores.int)),
      wis: getModifierForScore(Number(tempScores.wis)),
      cha: getModifierForScore(Number(tempScores.cha)),
    };

    // Update roll log and the score/mod displays directly using renderCharacter-style formatting
    rollLog.textContent = rolled.log;

    // Minimal render for scores/mods without constructing full character
    const fmt = (score, mod) => `${score} (${mod >= 0 ? "+" : ""}${mod})`;

    strEl.textContent = fmt(tempScores.str, tempMods.str);
    dexEl.textContent = fmt(tempScores.dex, tempMods.dex);
    conEl.textContent = fmt(tempScores.con, tempMods.con);
    intEl.textContent = fmt(tempScores.int, tempMods.int);
    wisEl.textContent = fmt(tempScores.wis, tempMods.wis);
    chaEl.textContent = fmt(tempScores.cha, tempMods.cha);

    modStrEl.textContent = `STR mod: ${tempMods.str >= 0 ? "+" : ""}${tempMods.str}`;
    modDexEl.textContent = `DEX mod: ${tempMods.dex >= 0 ? "+" : ""}${tempMods.dex}`;
    modConEl.textContent = `CON mod: ${tempMods.con >= 0 ? "+" : ""}${tempMods.con}`;
    modIntEl.textContent = `INT mod: ${tempMods.int >= 0 ? "+" : ""}${tempMods.int}`;
    modWisEl.textContent = `WIS mod: ${tempMods.wis >= 0 ? "+" : ""}${tempMods.wis}`;
    modChaEl.textContent = `CHA mod: ${tempMods.cha >= 0 ? "+" : ""}${tempMods.cha}`;
  });

  exportJsonBtn.addEventListener("click", () => {
    if (window._lastChar) downloadJSON(window._lastChar, `${window._lastChar.name.replace(/\s+/g, "_")}.json`);
    else alert("Generate a character first.");
  });

  copyBtn.addEventListener("click", () => {
    if (window._lastChar) copyToClipboard(JSON.stringify(window._lastChar, null, 2));
    else alert("Generate a character first.");
  });

  // ----- Init -----
  populateSelects();
  classSelect.value = CLASSES[0].id;
  raceSelect.value = RACES[0].id;
  bgSelect.value = BACKGROUNDS[0].id;

  renderCharacter({
    name: "—",
    class: CLASSES[0],
    race: RACES[0],
    background: BACKGROUNDS[0],
    scores: { str: "—", dex: "—", con: "—", int: "—", wis: "—", cha: "—" },
    mods: { str: 0, dex: 0, con: 0, int: 0, wis: 0, cha: 0 }, // safe placeholders
    gear: [],
    log: "No rolls yet.",
  });

  const exportPdfBtn = document.getElementById("exportPdfBtn");

  // Paste your Base64 string from the .txt file here
  const bgBase64 =
    "data:image/png;base64,";

  exportPdfBtn.addEventListener("click", () => {
    if (!window._lastChar) return alert("Generate a character first.");

    const { jsPDF } = window.jspdf;
    const doc = new jsPDF({ orientation: "landscape" });

    const c = window._lastChar;
    const pageWidth = doc.internal.pageSize.getWidth();
    const pageHeight = doc.internal.pageSize.getHeight();
    let yLeft = 15;
    let yRight = 15;

    const colLeftX = 10;
    const colRightX = pageWidth / 2 + 10;
    const lineHeight = 5;

    // Helper: add a new page and redraw background if needed
    const addPageIfNeeded = (y, extraSpace = 10) => {
      if (y + extraSpace > pageHeight) {
        doc.addPage();
        doc.addImage(bgBase64, "PNG", 0, 0, pageWidth, pageHeight); // full-page background
        yLeft = yRight = 15;
        return true;
      }
      return false;
    };

    // Draw background on the first page
    doc.addImage(bgBase64, "PNG", 0, 0, pageWidth, pageHeight);

    // --- Header ---
    doc.setFont("helvetica", "bold");
    doc.setFontSize(18);
    doc.text("Shadowdark Character", pageWidth / 2, 10, { align: "center" });

    doc.setFont("helvetica", "normal");
    doc.setFontSize(12);

    // --- Left Column: Character Info ---
    doc.text(`Name: ${c.name}`, colLeftX, yLeft);
    yLeft += lineHeight;
    doc.text(`Class: ${c.class.name} — Race: ${c.race.name}`, colLeftX, yLeft);
    yLeft += lineHeight;
    doc.text(`Background: ${c.background.name}`, colLeftX, yLeft);
    yLeft += lineHeight;
    doc.text(`Hit Die: ${c.class.hd}`, colLeftX, yLeft);
    yLeft += lineHeight * 2;

    // --- Ability Scores Table ---
    doc.setFont("helvetica", "bold");
    doc.text("Ability Scores", colLeftX, yLeft);
    yLeft += lineHeight + 1;
    doc.setFont("helvetica", "normal");

    const abilities = ["str", "dex", "con", "int", "wis", "cha"];
    const colWidth = 25;

    // Header row
    abilities.forEach((ab, i) => {
      doc.text(ab.toUpperCase(), colLeftX + i * colWidth, yLeft, { align: "center" });
    });
    yLeft += lineHeight + 2;

    // Scores row
    abilities.forEach((ab, i) => {
      const score = c.scores[ab];
      const mod = c.mods[ab];
      doc.text(`${score} (${mod >= 0 ? "+" : ""}${mod})`, colLeftX + i * colWidth, yLeft, { align: "center" });
    });
    yLeft += lineHeight * 2;

    // --- Right Column: Gear ---
    doc.setFont("helvetica", "bold");
    doc.text("Starting Gear:", colRightX, yRight);
    yRight += lineHeight;
    doc.setFont("helvetica", "normal");

    c.gear.forEach((item) => {
      if (addPageIfNeeded(yRight, lineHeight)) {
        // yLeft and yRight reset inside addPageIfNeeded
      }
      doc.text(`• ${item}`, colRightX, yRight);
      yRight += lineHeight;
    });

    yRight += lineHeight;

    // --- Save PDF ---
    doc.save(`${c.name.replace(/\s+/g, "_")}.pdf`);
  });
});
